<?php

class BuildingCampusguideCommandControllerTest extends CampusguideControllerTest
{

    // VARIABLES


    // /VARIABLES


    // CONSTRUCTOR


    public function __construct()
    {
        parent::__construct( "BuildingCampusguideCommandController Test" );
    }

    // /CONSTRUCTOR


    // FUNCTIONS


    // ... GET


    public static function getCommandWebsite( $arguments )
    {
        return sprintf( "http://%s%s/command.php?/%s&mode=3", $_SERVER[ "HTTP_HOST" ],
                dirname( $_SERVER[ "REQUEST_URI" ] ), $arguments );
    }

    // ... /GET


    public function testShouldSaveOverview()
    {

        // Create test Facility
        $facility = $this->addFacility();

        // Create test Building
        $building = $this->addBuilding( $facility->getId() );

        // Create image path
        $buildingImagePath = Resource::image()->campusguide()->building()->getBuildingOverview(
                $building->getId(), Api::MODE_TEST );

        // Delete Building image if it exists
        if ( file_exists( $buildingImagePath ) )
        {
            unlink( $buildingImagePath );
        }

        // Get Website
        $url = self::getCommandWebsite(
                sprintf( "%s/%s/%s", BuildingCampusguideCommandController::$CONTROLLER_NAME,
                        BuildingCampusguideCommandController::COMMAND_SAVEOVERVIEW, $building->getId() ) );

        // Generate image data
        $imageData = <<<EOD
data:image/png;base64,
EOD;

        // Do POST
        $data = $this->post( $url, $imageData, "application/upload" );

        $this->showHeaders();
        $this->showRequest();
        $this->showSource();

        // Assert response
        if ( $this->assertResponse( Controller::STATUS_CREATED, "Should be correct response" ) )
        {

            // Image should exist
            $this->assertTrue( file_exists( $buildingImagePath ),
                    sprintf( "Image \"%s\" should exist", $buildingImagePath ) );

        }

    }

    // /FUNCTIONS


}

?>